      <h1>Hello</h1>
      <i className="btn btn-info" onClick={() => setVisible(true)}>Create new SuperUser</i>
      <Model isOpen={visible} on >
        <input placeholder="name" /><br />
        <input placeholder="name" /><br />
        <input placeholder="name" /><br />
        <input placeholder="name" /><br />
        <i className="btn btn-danger" onClick={() => setVisible(false)}>Go back</i>
      </Model>
    </div>
  );
}

